#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>
#include <vector>

#include "Object.h"
#include "Stream.h"
#include "OutputDev.h"
#include "PDFDoc.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  // Define parameters for `displayPageSlice`.
  // The int parameter should generally be 1, relating to a page number (so must be non-negative)
  // Others are random and may be anything.
  int pageNum = 1;
  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();
  int sliceX = fdp.ConsumeIntegral<int>();
  int sliceY = fdp.ConsumeIntegral<int>();
  int sliceW = fdp.ConsumeIntegral<int>();
  int sliceH = fdp.ConsumeIntegral<int>();

  std::vector<char> remainingData = fdp.ConsumeRemainingBytes<char>();

  Object obj;
  obj.initNull();
  MemStream *str = new MemStream(remainingData.data(), 0, remainingData.size(), &obj);

  PDFDoc *doc = new PDFDoc(str, NULL, NULL, NULL);

  if (doc->isOk()) {
    doc->displayPageSlice(NULL, pageNum, hDPI, vDPI, rotate, useMediaBox, crop, printing, sliceX, sliceY, sliceW, sliceH, NULL, NULL);
  }

  delete doc;

  return 0;
}

